import React from "react";
import {
  Route,
  Routes,
} from "react-router-dom";
import Content from "../Content/Content";

import VocabularyPage from "../Content/VocabularyPage";

function RouterURL({CourseList , removeCourse , addCourse}) {
    return ( 
        <Routes>
            <Route exact path="/" element={<Content CourseList = {CourseList} removeCourse = {removeCourse} addCourse = {addCourse}/>} />
            <Route exact path="/vocabulary" element={<VocabularyPage />} />

        </Routes>
    );
}

export default RouterURL;
